import React from "react";
import PropTypes from "prop-types";
import "antd/dist/antd.css";
//완전 공통인 부분을 여기에 넣는다.

const App = ({ Component }) => {
  return (
    <>
      <Component />
    </>
  );
};

App.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
